/*import React, { Component } from 'react';






export default class WcList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            properties: [],
            bicycle: true
        };
    }

    componentDidMount() {
        fetch('http://localhost:3001/water', { headers: { 'Content-Type': 'application/json' }, })
            .then(r => r.json())
            .then(properties => {
                this.setState({ properties, bicycle: false });
            });
    }


    render() {
        const { properties } = this.state;
        console.log(properties)
        return (
            <div>


                <p properties={properties}>openfire:</p>


            </div>
        )
    }
}


